          title={editMode ? 'Click to edit image' : ''}
        />
        <img
          src="/Portraits/IMG_3631.JPG"
          alt="Portrait IMG_3631"
          style={{ width: '300px', maxWidth: '90%', borderRadius: '8px', cursor: editMode ? 'pointer' : 'default' }}
          title={editMode ? 'Click to edit image' : ''}
        />
      </div>
    </div>
  );
}
